import React from 'react'
import Banner from './Home/Banner.js';
import CustomNavbar from './Home/CustomNavbar';
import MainPageCategory from './Home/MainPageCategory'

export default function MainPage() {
  return (
    <div>
      <CustomNavbar/>
      <Banner/>
      <MainPageCategory/>
    </div>
  )
}
